(1, 325, 'السلام عليكم يا شباب من فضلكم في تاسك هبعتهالكم محتاجها في اسرع وقت ممكن تشتغلوا عليها يومياً\nمحتاج إنشاء برودكاست على الواتساب لكل مرحلة بأولياء الأمور موجوده معانا فعلياً الان شغالين ( هنستخدم في البرودكاست الرقم الفعلي اللي بنتواصل بيه مع ولي الأمر و مش شرط يكون هو المكتوب ع السيستم او ع الشيت ) \nأنا استخرجت لكم من السيستم بيانات العملاء و فلترتها حسب المراحل بتاعتكم في ملف اكسل لكل واحده منكم\n\nتسمية البرودكاست على تليفوناتكم، هتكون زي كده مثلاً\nG1,2,3 - 2022-23\n\nالغرض من البرودكاست هو تجميع أولياء الأمور لكل مرحلة في حالة الرغبه في إرسال رسالة لمرحلة معينه أو إرسال رسالة للجميع ع الخاص', '18', NULL, '90', 0, '1319', '2023-01-01 23:48:54', '2023-01-04 22:00:00', NULL, 1, '2023-01-02 00:00:00', NULL, '2023-01-02 00:23:17'),
